/*
 * @Date: 2019-06-12 16:26:47
 * @LastEditors: lianggua
 * @LastEditTime: 2020-11-21 16:49:42
 */
let APIV1 = 'https://tokenwin.one';
let APIV2 = 'https://phix.cn';

if (phixSit === 'prod' || phixSit === 'dev') {
  let myhost = 'tokenwin.one';
  const hostnameArr = location.hostname.split('.');
  if (hostnameArr.length >= 2) {
    myhost = hostnameArr[hostnameArr.length - 2] + '.' + hostnameArr[hostnameArr.length - 1]
  }
  if (myhost === 'imbin.cn') {
    myhost = 'tokenwin.one';
  }
  APIV1 = 'https://' + myhost;
}
APIV1 = 'https://kit.imbin.cn';
const exMap = new Map([
  ['OKEX_OKEX', 'OK'],
  ['HUOBI_HUOBI', '火币'],
  ['OKEX_HUOBI', 'OK火币'],
  ['OKEX_BITMEX', 'OKBITMEX']
]);

const contractMap = new Map([
  ['W', '永续'],
  ['S', '现货'],
  ['T', '当周'],
  ['N', '次周'],
  ['Q', '季度'],
  ['B', '次季'],
  ['I', '指数'],
  ['X', '当周金'],
  ['Y', '次周金'],
  ['Z', '季度金'],
  ['H', '次季金'],
  ['V', '永续金']
]);
const iconFontJS = window.location.hostname === 'localhost' ? '/iconfont/iconfont.js' : `${APIV1}/www/Public/kit-dva/dist/iconfont/iconfont.js`;
module.exports = {
  isProd: true, // 上线时设为true
  name: 'imbin',
  prefix: 'imbin',
  footerText: 'imbin',
  logo: '/logo.svg',
  pageSize: 10,
  iconFontCSS: '/iconfont/iconfont.css',
  iconFontJS,
  CORS: [
    APIV1, 
    APIV2,
    'https://tokenwin.ai',
    'https://tokenwin.pro',
    'https://tokenwin.one'
  ],
  openPages: ['/login'],
  apiPrefix: '/api/v1',
  APIV1,
  APIV2,
  api: {
    Strategy: `${APIV1}/api/Strategy`,
    custom: `${APIV1}/api/custom`,
    api1: `${APIV1}`
  },
  exMap,
  contractMap
}
